import React from "react";
import { QuillDeltaToHtmlConverter } from "quill-delta-to-html";
import DOMPurify from "dompurify";
import ContentWrapper from "./ContentWrapper";

export default function Article() {
  const parsedDelta = JSON.parse(testStringDelta);

  const converter = new QuillDeltaToHtmlConverter(parsedDelta.ops, {});
  const html = converter.convert();
  const safeHtml = DOMPurify.sanitize(html);

  const articleTitle = "Article Title";

  return (
    <ContentWrapper>
      <h1 className="text-2xl font-bold mb-4 text-center">{articleTitle}</h1>
      <div
        className="article-content"
        dangerouslySetInnerHTML={{ __html: safeHtml }}
      ></div>
    </ContentWrapper>
  );
}

const testStringDelta = JSON.stringify({
  ops: [
    { insert: "Helloasdasdasdasda" },
    {
      insert: {
        image:
          "data:image/jpeg;base64,",
      },
    },
    { attributes: { header: 1 }, insert: "\n" },
    { insert: "Some <script/> <meta>" },
    { insert: "<script/>" },
    { attributes: { bold: true }, insert: "initial" },
    { insert: " " },
    { attributes: { underline: true }, insert: "content" },
    { insert: "\n" },
  ],
});
